  false,\n\t\"url\": null,\n\t\"notes\": \"Tropical cyclones are one of the nature?s
  destructive phenomena, causing loss of lives and property damage. The affected countries
  associated with the cyclones of this ocean basin include the countries of East Asia
  (South Korea, Japan and China) and the countries of Southeast Asia and the island
  nations. Timely warning of these events is of paramount importance for these countries
  of this region. Towards this goal, Tropical Cyclone monitoring activity was initiated
  prior to 2009 as part of supporting the USAID disaster relief efforts. Archiving
  of the data in GIS format (ESRI shape files) was commenced during the beginning
  of the year 2009. Seven major ocean basins were identified for the purpose of dissemination,
  namely, the Atlantic, East Pacific, Central pacific, Western Pacific, South Pacific,
  North Indian and the South Indian basins. Only the storm that attained tropical
  cyclone status is archived.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
